import React, {useState, useEffect} from 'react'
import axios from 'axios';


const CovidNewsList = () => {
const [posts, setPosts] = useState([]);
  return (
    <div>
      <ul>
        {
        posts.map(post => <li key={post.id}>{post.title}</li>)
        }
      </ul>
    </div>
  );
};
export default CovidNewsList;
